import React from 'react';
import './App.css';
import phone from './image/phone_ko.png'
import qrcode from './image/qrcode_global.svg'

const App =()=>{
  return (
      <div className="App">
      <Phone></Phone>
      <Title></Title>
      </div>

  );
}
const Phone = ()=>{
  return(
    <>
    <div className="Phone">
      <img src ={phone} alt ="휴대폰 화면"></img>
    </div>
    </>
  );
}
const Title = () =>{
  return(
    <>
    <h1 className="Title">이상향 테스트</h1>
    </>
  );
}
const Content = () =>{
  return(
    <>
    <h2 className="Content">나에게 맞는 향수 찾기</h2>
    </>
  );
}
const Qrcode = ()=>{
  return(
    <>
     <img src ={qrcode} alt ="휴대폰 화면"></img>
    </>
  );
}
export default App;
